            Leer apellidos;

            Limpiar Pantalla;

            Escribir  "Hola Sr(a) ", nombre, " ", apellidos, " bienvenido!";

          FinProceso
          `}</pre>
      </div>

      <div>
        <p className="enunciado-programas">2. Realizar un programa el cual solicite su nombre, apellidos, edad y estatura.</p>
